import React from 'react';

function Profile() {
  const email = localStorage.getItem('user');
  console.log(email);
  return (
    <div className="profile">
      <h1 data-testid="page-title">Profile</h1>
      <h2 data-testid="profile-email">{ email }</h2>
    </div>
  );
}

export default Profile;
